  BIND(urn:uuid:f1769642-9aeb-11e5-91da-b8763fd99c5f AS ?substation1)

  # Ensure the substation has a name
  ?substation1 cim:IdentifiedObject.name "SYLLING" .

  # Find lines connected to this substation
  ?line a cim:Line ;
        cimex:connectedThroughPart ?substation1, ?substation2 .

  # Ensure the second substation is distinct and has a name
  ?substation2 a cim:Substation ;
               cim:IdentifiedObject.name ?substation2Name .
  FILTER(?substation1 != ?substation2)

  # Optionally get the line name
  OPTIONAL { ?line cim:IdentifiedObject.name ?lineName }
}

